function delMessage(b) {
    if (!b) {
        Plotly.STATUS_MSGS = [];
    }
    for (var a = 0; a < Plotly.STATUS_MSGS.length; a++) {
        if (Plotly.STATUS_MSGS[a] == b) {
            Plotly.STATUS_MSGS.splice(a, 1);
            break;
        }
    }
    if (Plotly.STATUS_MSGS.length) {
        $("#statustab").show().find("p").text(Plotly.STATUS_MSGS.join(" "));
    } else {
        $("#statustab").hide();
    }
}
